import React from "react";

export function Img () {
	fetch('https://api.thecatapi.com/v1/images/search')
        .then(function(res) {
            console.log(res)
            return res.json();
        })
        .then((data) => {
            const catImg = data[0].url;
            console.log(data[0].url)
						return catImg;
        })

	return(
	<section>
		<img src ={catImg} ></img>
	</section>
	)
}

export default Img;
